import React from "react";
import "./About.css";
import { Particles } from "react-particles-js";
import particleOpt from "./particles";
function About() {
  return (
    <div>
      <div id="main">
        <article id="Professional">
          <header>Professional Experience</header>
          <article id="viasat">
            <header>Viasat Experience</header>
            <div id="somepic">
              <img src="assets/viasat.jpg" />
            </div>
            <p>Something Something something about viasat</p>
          </article>
        </article>
        <article id="Proficiencies">
          <header>Skills</header>
        </article>
        <article id="Non-Technical">
          <header>Non-Technical Experience</header>
        </article>
        <article id="Passions">
          <header>Passions</header>
        </article>
      </div>
      <Particles className="particles" params={particleOpt} />
    </div>
  );
}

export default About;
